                double minwidth=busScheduleHelper.calwidth(Container.Width,datestart.ToString("yyyyMMdd"),datestart.ToString("HHmm") , dateminwidth.ToString("yyyyMMdd"),dateminwidth.ToString("HHmm"), Container.Param.Number_of_days);
                if(iWidth<=minwidth)
                {
                    iWidth = minwidth;
